
<p><strong><em>Acrobasis aicha</em></strong> is a species of <a href="Pyralidae" title="wikilink">snout moths</a> in the genus <em><a href="Acrobasis" class="uri" title="wikilink">Acrobasis</a></em>. It was described by Asselbergs in 1998.</p>
